import "./Home.css";
import { useState, useEffect } from "react";
const Home = () => {
  const loadHandler = () => {
    const [audio] = useState(new Audio(url));
    //   const [playing, setPlaying] = useState(false);

    useEffect(() => {
      audio.play();
    }, []);
  };
  return (
    <div id="homeDiv" onLoad={loadHandler}>
      <audio>
        <source src="/audios/start.wav" type="audio/wav" />
      </audio>
      <h1 id="homeHead">Welcome to Tortuga islands!</h1>
      <h5>Login to continue.</h5>
      <button className="btn danger">Pirate Login</button>
      <br />
      <button className="btn success">Admin Login</button>
    </div>
  );
};

export default Home;
